import React from 'react';
import { TextField, Button, makeStyles } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    alignItems: 'center',
    width: '100%',
    padding: theme.spacing(2),
    borderTop: '1px solid white', // White border
    backgroundColor: 'transparent',
  },
  textField: {
    flex: 1,
    marginRight: theme.spacing(2),
    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'white', // White border
      },
      '& input': {
        color: 'white', // Text color
      },
    },
  },
  sendButton: {
    marginLeft: 'auto',
    color: 'white',
    borderColor: 'white',
  },
}));

const TextBoxWithSendButton = () => {
  const classes = useStyles();

  return (
    <div className={classes.root}>
      <TextField
        className={classes.textField}
        variant="outlined"
        placeholder="Type your message..."
      />
      <Button className={classes.sendButton} variant="outlined">
        Send
      </Button>
    </div>
  );
};

export default TextBoxWithSendButton;
